var Node = require('./node');

var Filo = function() {
  this.inicio = null;
  this.fim    = null;
};


Filo.prototype.push = function(propriedades) {
  var novo = new Node(propriedades);
  novo.prox = this.fim;

  if(this.fim) {
    this.fim.ant = novo;
  }
  else {
    this.inicio = novo;
  }
  this.fim = novo;
};

Filo.prototype.each = function(callback) {
  (function eaching(node) {
    if(node !== null) {
      callback(node);
      eaching(node.ant);
    }
  })(this.inicio);
};

